import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import { Card } from '../../components/card/Card';
import { ModalSavePin } from '../../containers/ModalSavePin/ModalSavePin';
import { ModalCreateFolder } from '../../containers/ModalCreateFolder/ModalCreateFolder';
import { Notification } from '../../components/Notification/Notification';
import { useAppContext } from '../../store/AppContext';

export const HomePage = () => {
    const { state, dispatch } = useAppContext();
    return (
        <div>
            <ModalSavePin open={false} />
            <ModalCreateFolder open={false} />
            <Notification
                message="Criado com sucesso!" 
                onclose={() => {
                    console.log('Clicou em fechar')
                }}
            />

            <span>{state.folders}</span>

            <Container fluid>
                <Row>
                    <Col xs={12} md={3}> <Card title="Matemática" image="https://img.freepik.com/fotos-premium/navio-pirata-longe-no-mar-azul_300943-130.jpg?w=740" total={0} /> </Col>
                    <Col xs={12} md={3}> <Card title="Trigonometria" image="https://img.freepik.com/fotos-premium/navio-pirata-longe-no-mar-azul_300943-135.jpg?w=740" total={0} /> </Col>
                </Row>
            </Container>
        </div>
    )
}
